import axios from "axios";

function getProduct(identifier, setProduct) {
  axios
    .post("/product", identifier)
    .then((res) => setProduct(res.data[0]))
    .catch((err) => console.log(err));
}

function getProducts(identifier, setProducts) {
  axios
    .post("/products", identifier)
    .then((res) => setProducts(res.data))
    .catch((err) => console.log(err));
}

function getUser(identifier, setUser) {
  axios
    .post("/user", identifier)
    .then((res) => setUser(res.data[0]))
    .catch((err) => console.log(err));
}

function getOrder(identifier, setOrder) {
  axios
    .post("/order", identifier)
    .then((res) => setOrder(res.data[0]))
    .catch((err) => console.log(err));
}

function getAddress(identifier, setAddress) {
  axios
    .post("/address", identifier)
    .then((res) => setAddress(res.data[0]))
    .catch((err) => console.log(err));
}

function createCart(identifier, setCart) {
  axios
    .post("/cart/create", identifier)
    .then((res) => setCart(res.data))
    .catch((err) => console.log(err));
}

function createUser(identifier, setUser) {
  axios
    .post("/user/create", identifier)
    .then((res) => setUser(res.data))
    .catch((err) => console.log(err));
}

function createShipping(identifier, setShipping) {
  axios
    .post("/shipping/create", identifier)
    .then((res) => setShipping(res.data))
    .catch((err) => console.log(err));
}

function createPayment(identifier, setPayment) {
  axios
    .post("/payment/create", identifier)
    .then((res) => setPayment(res.data))
    .catch((err) => console.log(err));
}

function createOrder(identifier, setOrder) {
  axios
    .post("/order/create", identifier)
    .then((res) => setOrder(res.data))
    .catch((err) => console.log(err));
}

function createAddress(identifier, setAddress) {
  axios
    .post("/address/create", identifier)
    .then((res) => setAddress(res.data))
    .catch((err) => console.log(err));
}

function deleteCart(identifier) {
  axios.post("/cart/delete", identifier).catch((err) => console.log(err));
}

function updateUser(identifier, setUser) {
  axios
    .post("/user/update", identifier)
    .then((res) => setUser(res.data))
    .catch((err) => console.log(err));
}

export {
  getProduct,
  getProducts,
  getUser,
  getAddress,
  getOrder,
  createCart,
  createUser,
  createShipping,
  createPayment,
  createOrder,
  createAddress,
  deleteCart,
  updateUser,
};
